import React from "react";
import '.'

const Hobbies = () =>{
    return(<>
          <h1 className="text-primary">Hobbies</h1>
            <ul class="skills__list">
                <li class="skills__list-item btn btn--plain bg-info">Cricket</li>
                <li class="skills__list-item btn btn--plain bg-info">Reading</li>
                <li class="skills__list-item btn btn--plain bg-info">Travelling</li>
                <li class="skills__list-item btn btn--plain bg-info">Music</li>
                
            </ul>
    </>); 
} 

export default Hobbies;
